Book.where(isbn: '0-394-41525-6').first_or_create!(isbn: '0-394-41525-6', title: 'The Andromeda Strain', author: 'Michael Crichton', genre: 'Techno-Thriller', abstract: 'The Andromeda Strain is a novel documenting the efforts of a team of scientists investigating a deadly extraterrestrial microorganism which rapidly and fatally clots human blood, while inducing insanity in some people.', pages: 350, image_cover_url: 'http://upload.wikimedia.org/wikipedia/en/b/bf/Big-andromedastrain.jpg', published_on: '1969-05-12', total_in_library: 1, author_id: 1)
Book.where(isbn: '0-394-51392-4').first_or_create!(isbn: '0-394-51392-4', title: 'Congo', author: 'Michael Crichton', genre: 'Techno-Thriller', abstract: 'Congo is a 1980 science fiction novel by Michael Crichton. The novel centers on an expedition searching for diamonds and investigating the mysterious deaths of a previous expedition in the dense rain forest of Congo. Crichton calls Congo a Lost World novel in the tradition founded by Henry Rider Haggard''s King Solomon''s Mines, featuring the mines of that work''s title.', pages: 348, image_cover_url: 'http://upload.wikimedia.org/wikipedia/en/thumb/4/42/Big-congo.jpg/200px-Big-congo.jpg', published_on: '1980-11-01', total_in_library: 2, author_id: 1)
Book.where(isbn: '0-394-56110-4').first_or_create!(isbn: '0-394-56110-4', title: 'Sphere', author: 'Michael Crichton', genre: 'Techno-Thriller', abstract: 'Sphere is a science fiction novel written by Michael Crichton and published in 1987. It was made into the film Sphere in 1998. The novel follows Norman Johnson as a psychologist who is engaged by the United States Navy to join a team of scientists assembled by the U.S. Government to examine an enormous spacecraft discovered on the bottom of the Pacific Ocean. The depth of coral covering the craft suggests that it has been lying there for over 300 years and so could only be of alien origin. The novel begins as a science fiction story, but quickly transforms into a psychological thriller, ultimately exploring the nature of the human imagination.', pages: 385, image_cover_url: 'http://upload.wikimedia.org/wikipedia/en/thumb/b/b8/Big-sphere.jpg/200px-Big-sphere.jpg', published_on: '1987-05-12', total_in_library: 3, author_id: 1)
Book.where(isbn: '978-0-937986-50-9').first_or_create!(isbn: '978-0-937986-50-9', title: 'The Dark Tower: The Gunslinger', author: 'Stephen King', genre: 'Fantasy', abstract: 'The Gunslinger is the first volume in the Dark Tower series, which Stephen King considers to be his magnum opus. Initially a fix-up novel that strung together five short stories published between 1978 and 1981, it was first published in book form in 1982. King substantially revised the novel in 2003, which is the version that is in print today. The story centers upon Roland Deschain, the last gunslinger who has been chasing after his adversary, "the man in black", for many years. The novel follows Roland''s trek through a vast desert and beyond in search of the man in black. Roland meets several people along his journey, including a boy named Jake Chambers who travels with him part of the way.', pages: 224, image_cover_url: 'http://upload.wikimedia.org/wikipedia/en/thumb/d/db/The_Gunslinger.jpg/200px-The_Gunslinger.jpg', published_on: '1982-06-10', total_in_library: 5, author_id: 2)
Book.where(isbn: '978-0-385-19957-5').first_or_create!(isbn: '978-0-385-19957-5', title: 'The Stand: The Complete & Uncut Edition', author: 'Stephen King', genre: 'Post-Apocalyptic', abstract: 'The Stand is a post-apocalyptic horror/fantasy novel by American author Stephen King. It expands upon the scenario of his earlier short story, "Night Surf". The novel was originally published in 1978 and was later re-released in 1990 as The Stand: The Complete & Uncut Edition; King restored some text originally cut for brevity, added and revised sections, changed the setting of the story from 1980 (which in turn was changed to 1985 for the original paperback release in 1980) to 1990, and updated a few pop culture references accordingly. The Stand was nominated for the World Fantasy Award for Best Novel in 1979, and was adapted into both a television miniseries for ABC and a graphic novel published by Marvel Comics.', pages: 1152, image_cover_url: 'http://upload.wikimedia.org/wikipedia/en/thumb/8/8d/The_Stand_Uncut.jpg/200px-The_Stand_Uncut.jpg', published_on: '1990-05-01', total_in_library: 4, author_id: 2)
Book.where(isbn: '978-1-4391-4850-1').first_or_create!(isbn: '978-1-4391-4850-1', title: 'Under The Dome', author: 'Stephen King', genre: 'Sci-Fi', abstract: 'Under the Dome is a science fiction novel by Stephen King published in November 2009. Set in and around a small Maine town, it tells an intricate, multi-character and point-of-view story of how the town''s inhabitants contend with the calamity of being suddenly cut off from the outside world by an impassable, invisible barrier; one that literally drops out of a clear blue sky.', pages: 1074, image_cover_url: 'http://upload.wikimedia.org/wikipedia/en/thumb/0/09/Under_the_Dome_Final.jpg/200px-Under_the_Dome_Final.jpg', published_on: '2009-11-10', total_in_library: 4, author_id: 2)
Book.where(isbn: '0-684-83339-5').first_or_create!(isbn: '0-684-83339-5', title: 'Catch-22', author: 'Joseph Heller', genre: 'Satire', abstract: 'Catch-22 is a satirical novel set during World War II from 1942 to 1944. It is frequently cited as one of the greatest literary works of the twentieth century. It uses a distinctive non-chronological third-person omniscient narration, describing events from the point of view of different characters. The separate storylines are out of sequence so that the timeline develops along with the plot. The novel follows Captain John Yossarian, a U.S. Army Air Forces B-25 bombardier. Most of the events in the book occur while the fictional 256th Squadron is based on the island of Pianosa, in the Mediterranean Sea, west of Italy. The novel looks into the experiences of Yossarian and the other airmen in the camp. It focuses on their attempts to keep their sanity in order to fulfill their service requirements so that they may return home. The phrase "Catch-22", "a problematic situation for which the only solution is denied by a circumstance inherent in the problem or by a rule," has entered the English language.', pages: 453, image_cover_url: 'http://upload.wikimedia.org/wikipedia/en/thumb/9/99/Catch22.jpg/220px-Catch22.jpg', published_on: '1961-11-11', total_in_library: 2, author_id: 3)
Book.where(isbn: '978-0-345-50496-8').first_or_create!(isbn: '978-0-345-50496-8', title: 'The Passage', author: 'Justin Cronin', genre: 'Post-Apocalyptic', abstract: 'The Passage begins in the near future and details an apocalyptic and, later, post-apocalyptic world that is overrun by vampire-like beings who are infected by a highly contagious virus. What begins as a project to develop a new immunity-boosting drug based on a virus carried by an unnamed species of bat in South America eventually becomes the virus that transforms the world. The novel begins in 2014 and spans more than ninety years, as colonies of humans attempt to live in a world filled with superhuman creatures who are continually on the hunt for fresh blood. The Passage is the first novel of a planned trilogy; the second book The Twelve was released in 2012, with the third book The City of Mirrors due to be released in 2014.', pages: 879, image_cover_url: 'http://enterthepassage.com/wp-content/themes/EnterthePassage/images/Passage-small.jpg', published_on: '2010-06-08', total_in_library: 4, author_id: 4)
Book.where(isbn: '978-0-752-89786-8').first_or_create!(isbn: '978-0-752-89786-8', title: 'The Twelve', author: 'Justin Cronin', genre: 'Post-Apocalyptic', abstract: 'At the end of The Passage, the great viral plague had left a small group of survivors clinging to life amidst a world transformed into a nightmare. In the second volume of this epic trilogy, this same group of survivors, led by the mysterious, charismatic Amy, go on the attack, leading an insurrection against the virals: the first offensives of the Second Viral War.', pages: 568, image_cover_url: 'http://upload.wikimedia.org/wikipedia/en/1/17/The_Twelve_Cronin.jpg', published_on: '2012-10-16', total_in_library: 5, author_id: 4)
Book.where(isbn: '978-1-476-73511-5').first_or_create!(isbn: '978-1-476-73511-5', title: 'Wool', author: 'Hugh Howey', genre: 'Dystopian', abstract: 'In a ruined and toxic future, a community exists in a giant silo underground, hundreds of stories deep. There, men and women live in a society full of regulations they believe are meant to protect them. Sheriff Holston, who has unwaveringly upheld the siloâ€™s rules for years, unexpectedly breaks the greatest taboo of all: He asks to go outside. His fateful decision unleashes a drastic series of events. An unlikely candidate is appointed to replace him: Juliette, a mechanic with no training in law, whose special knack is fixing machines. Now Juliette is about to be entrusted with fixing her silo, and she will soon learn just how badly her world is broken. The silo is about to confront what its history has only hinted about and its inhabitants have never dared to whisper. Uprising.', pages: 528, image_cover_url: 'http://upload.wikimedia.org/wikipedia/commons/thumb/1/1b/Hugh_C_Howey_Wool_Omnibus.jpg/200px-Hugh_C_Howey_Wool_Omnibus.jpg', published_on: '2012-01-25', total_in_library: 5, author_id: 5)
Book.where(isbn: '978-1-481-98355-6').first_or_create!(isbn: '978-1-481-98355-6', title: 'Shift', author: 'Hugh Howey', genre: 'Dystopian', abstract: 'In 2007, the Center for Automation in Nanobiotech (CAN) outlined the hardware and software platform that would one day allow robots smaller than human cells to make medical diagnoses, conduct repairs, and even self-propagate. In the same year, the CBS network re-aired a program about the effects of propranolol on sufferers of extreme trauma. A simple pill, it had been discovered, could wipe out the memory of any traumatic event. At almost the same moment in humanity''s broad history, mankind had discovered the means for bringing about its utter downfall. And the ability to forget it ever happened. This is the sequel to the New York Times bestselling WOOL series.
Contains First Shift, Second Shift, and Third Shift.', pages: 608, image_cover_url: 'data:image/jpeg;base64,', published_on: '2013-01-28', total_in_library: 5, author_id: 5)
Book.where(isbn: '978-1-490-90438-2').first_or_create!(isbn: '978-1-490-90438-2', title: 'Dust', author: 'Hugh Howey', genre: 'Dystopian', abstract: 'WOOL introduced the world of the silo. SHIFT told the story of its creation. DUST will describe its downfall.', pages: 464, image_cover_url: 'data:image/jpeg;base64,', published_on: '2013-08-17', total_in_library: 5, author_id: 5)
